insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (269,'怎么才能让他早点回家呢？','http://m.pengfu.com/content/1113515/?from=jinli','','',1419490203,1420095003,1,13,109,1419490203,1419490203,1,'“我老公最近总是很晚回家，怎么才能让他早点回家呢？”“很简单，你给他打个电话，在电话还没挂的时候轻轻地说一句，讨厌，别碰人家，电话还没挂啦！” ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (270,'明天开始收费','http://m.pengfu.com/content/1113514/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'我女朋友超级懒，每次起床都叫不起来。 这天我终于忍不住了想起网上流传的一句话:“如果你不能在床上赚钱的话，就别窝在床上！”谁料她竟回了一句:“好吧，明天开始收费。”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (271,'别绿了你的男人','http://m.pengfu.com/content/1113513/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'今天一女的给我说：男的苦点累点无所谓，别苦了跟着你的女人！我随口就回了一句：女人你美点靓点没关系，别绿了你的男人！然后这姐们不理我了，是我说错什么了？ ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (272,'生理上的可以吗','http://m.pengfu.com/content/1113512/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'今天是本学期最后一节物理实验课啦，上课前漂亮的老师做啦一下总结，并说：到以后你们有什么需要的，尽管找我，什么生活上的，学习方面的都可以。 这时旁边饥渴的小伙伴来啦句：生理上的可以吗？当时全场都醉啦！');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (273,'这是只呆头鸟','http://m.pengfu.com/content/1113511/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'一个人去朋友家做客，住了很久还不走，主人说：“今天我把院子里的橘树剧倒，捉树上的鸟给你吃。 ”这个人说：“只怕树还没倒，树上的鸟早飞走了。”主人说：“这是只呆头鸟，不知道什么时候该走了。”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (274,'失意时笑送给自己','http://m.pengfu.com/content/1113510/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'一个人跑到弥勒佛前问道：“你为什么整天总是笑呵呵的？你有啥秘诀吗？”弥勒佛看看他说：“得意时笑曾给别人。 ”“这个我懂，可是现在庙里很是冷清啊？你怎么还会笑的出来呢？”那个人心存疑虑忍不住就又问道。弥勒佛看了看他说道：“失意时笑送给自己。”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (275,'蛋卷的味道','http://m.pengfu.com/content/1113509/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'一个文学评论家遭到受批评的作家的反驳，说：“你没写过作，也不是作家，怎么知道文学作品的好坏呢？”评论家说：“我不是母鸡，没生过蛋，可我比任何一只母鸡都清楚蛋卷的味道！” ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (276,'刚做官与当官很久了的区别','http://m.pengfu.com/content/1113507/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'古代一官老爷去做官袍，裁缝问：“老爷是刚做官，还是当官很久了？”问：“这有区别吗？”裁缝说：“如果是刚做官，官袍要前襟短，后面长，因为总是点头哈腰奉承上司，要是当官很久做了大官，就得前面襟后面短了，因为总是腆胸叠杜趾高气扬的了。 ”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (277,'世间万般愁苦事','http://m.pengfu.com/content/1113505/?from=jinli','','',1419490207,1420095007,1,13,109,1419490207,1419490207,1,'一个人很吝啬，朋友来做客，招待很不好，酒席上只有几只生梨和一只死鳖。 朋友见景生情吟诗道：“世间万般愁苦事，无非生离（生梨）和死别（死鳖）。”');
