insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (491,'堵车','http://m.pengfu.com/content/1114890/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'上班路上，千里车流，万 里人潮。 望大街内外，车行如龟，司机烦躁，一步不动，总是红灯憋出尿。交通如此多焦，引无数大款上公交。惜奥迪A6，慢如蜗牛。奔驰宝马，无处发飙。一代天骄，兰博基尼，泪看电驴儿把车超。俱往矣,还数自行车,边蹬边笑。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (492,'科学知识','http://m.pengfu.com/content/1114889/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'和闺密跑完步超累，想找个地方坐一会儿。 我对她说，运动后不要马上坐噢，不然屁股会变大！这货突然惊喜地瞪着双眼，一言不发走到长凳边，跪下，把胸部放在了上面！我唯一能做的就是淡定的转身离开。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (493,'情侣聊天','http://m.pengfu.com/content/1114887/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'一对情侣QQ聊天，女的在家用4M宽带，男的在学校用2.5G校园网。 女：你爱我不？男的没反应。女又问：你在学校是不是有别的女人？男：是啊！当然啦！女：你竟然这样对我，你到底有没爱过我？男：那是不可能的事情！！结果他们分手了。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (494,'理想终成现实','http://m.pengfu.com/content/1114886/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'小时候看医疗剧，医生们个个把白大褂穿得像高级定制修身风衣，英俊之气旁漏侧出。 后来，我也有了白大褂。。。才发现。。。短袖的穿上像卖卤肉的，长袖的穿上像卖馒头的，扣着扣子像面粉厂的，敞着穿像精神病院跑出来的。。。。。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (495,' 我就是那个被绊的女生','http://m.pengfu.com/content/1114885/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'当你正在食堂吃饭,而对面突然有个女生被绊了一下朝你扑过来。 你的第一反应是什么？普通青年：我躲……文艺青年：我接……213青年： 捂住饭！！！我绝对不会告诉你我就是那个被绊的女生……而又恰好碰到了213青年……');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (496,'还记得儿子的长相吗？冤有头债有主','http://m.pengfu.com/content/1114884/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'我昨晚证明了，人的大脑在梦境中具备和清醒时完全一样的逻辑思考和情感能力。 我梦见我有了一个十岁的大胖儿子，欣喜若狂，忽然又想到我跟梦里的老婆才认识三年，醒来的时候我老泪纵横，泣不成声。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (497,'敢泡老子的马子','http://m.pengfu.com/content/1114883/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'野鸡被狐狸抓住，正在拔毛。 老虎赶到，一脚踢飞狐狸，喝道：“敢泡老子的马子，找死！”老虎低头一看野鸡，浑身光溜，只剩屁股还有几根羽毛，大惊：“好险哪，差点让丫得手！”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (498,'还是朋友眼贼  ','http://m.pengfu.com/content/1114882/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'点菜的时候，小姑娘服务员盘着头发，很是好看。 可是等到上第一道菜的时候，头发垂了下来。等上第二道菜的时候，头发又盘了上去。我说“这服务员有病吧！上个菜，一会一个造型！”朋友说“人家那是个双胞胎！”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (499,'老爸说你什么好呢 ','http://m.pengfu.com/content/1114881/?from=jinli','','',1419562846,1420167646,1,13,109,1419562846,1419562846,1,'妈妈出门了，爸爸去房后的菜园摘菜，采回许多蘑菇炖了猪肉，看我喜欢吃。 爸爸就没动筷。吃完我去书房学习。妈妈下班后，就听见妈妈问爸爸：“你们吃的啥？”爸爸说：“我在菜园里采的野生蘑菇，也不知有没有毒，全叫儿子一个人吃了，要是没事，我明天再去采');
