insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (515,'这下说不出话来了','http://m.pengfu.com/content/1115125/?from=jinli','','',1419568204,1420173004,1,13,109,1419568204,1419568204,1,'昨晚上买了哥俩好，今早上准备粘东西，可是找遍屋子都没有找到，正奇怪每天早上都喜欢唱歌的儿子怎么没有声音了，走进房间一看才发现儿子居然将哥俩好喝了，我可怜的儿子赶紧送医院吧 ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (516,'这是真钞哦','http://m.pengfu.com/content/1115124/?from=jinli','','',1419568204,1420173004,1,13,109,1419568204,1419568204,1,'拿着一九八几年的百元大钞去买东西，店家是一个二十岁左右的姑娘、居然不认识是真钞、万般无奈之际她居然将自己的姥姥请来辨别真伪、店家要不要这么认真、姥姥可有八十岁了 ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (517,'给侄女讲故事','http://m.pengfu.com/content/1115122/?from=jinli','','',1419568204,1420173004,1,13,109,1419568204,1419568204,1,'那天小侄女让我给她讲故事。 我实在不愿意讲，就随口敷衍她从前，有一只天鹅，变成了美女，嫁给了王子……小侄女突然无限忧郁地说“那王子让她生宝宝，她下个蛋怎么办？”我……我……不知道……');
