insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (519,'这火咋吹不灭','http://m.pengfu.com/content/1115120/?from=jinli','','',1419568204,1420173004,1,13,109,1419568204,1419568204,1,'弟弟小时候很调皮，总爱拿着爸的打火机玩。 妈看到了就嚷他，不让玩火。他就偷着玩，一次紧挨着棉门帘玩，由于太近门帘给点着了，他只知道火一吹就灭，可他越吹越大，吓得他大叫哥这火咋吹不灭...');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (520,'兄弟借我点卫生纸行不','http://m.pengfu.com/content/1115119/?from=jinli','','',1419568204,1420173004,1,13,109,1419568204,1419568204,1,'内急跑到公厕解决问题，刚蹲下一分钟就听到隔壁刺啦撕拉的声音，吓我一跳，就听到：隔壁的兄弟能不能借我点纸、也不知怎么回事已经擦了一百多遍屁股了，就是觉得不干净、连衣服都当卫生纸用了..... ');
