insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (541,'人人平等','http://m.pengfu.com/content/1115315/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'唐僧：“佛曰：众生平等，悟空你不能歧视韩国人。 ”悟空：“师傅我没呀，你看我都把棒子塞耳朵的，真歧视就塞菊花里了。”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (542,'北京大风','http://m.pengfu.com/content/1115314/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'北京可以让您一年四季走在时尚的前沿，大风可以把您的发型从二八分吹成三七分，接着是中分，从中分直接搂成大背，一天到晚发型绝不重样，无论男女老少北京大风竭诚为您服务。 ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (543,' 大叔怎么了','http://m.pengfu.com/content/1115313/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'昨天和男友坐公交，旁边一位大叔拿着一个手机，忽然电话响了；大叔立马接起：“喂？喂？？喂？？？”声音一声比一声洪亮，正待大家都探头一看究竟的时候；他放下电话自言自语道：“哦，是短信！ ” ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (544,'苏菲超强吸收，醉了','http://m.pengfu.com/content/1115312/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'一闺蜜前几天跟我说她尿床了。 What？什么情况？她说，天太冷，不想出被窝，想试试苏菲夜用的超强吸收力怎么样。于是…就像谈了一场错误的恋爱，暖一时，凉一被子！');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (545,'我很有意见！','http://m.pengfu.com/content/1115311/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'上个周末，我在网吧打CF。 手机铃声突然响起，遂接听之。耳边传来朋友语重心长的话语，都二十几岁的人了，整天就知道上网打游戏难怪找不到女朋友，能不能有点出息埃我纳闷无比，回句你有什么意见?我很有意见，我这三缺一。。。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (546,'司机也兴奋','http://m.pengfu.com/content/1115310/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'刚才打车，司机问我听歌不？我说听听吧。 结果没想到这SB给我唱了一路。。。这货唱到兴起还自言自语地喊着：“掌声在哪里？随后按几下喇叭。这还不是高潮，这奇葩又喊着：“你们的双手在哪里？让我看到你们的双手！ ”我正纳闷着，然后看到他启动了雨刷…');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (547,'厦门市','http://m.pengfu.com/content/1115309/?from=jinli','','',1419572404,1420177204,1,13,109,1419572404,1419572404,1,'背景，厦门市有两个区，一个叫思明，一个叫湖里------某同事从思明区调往湖里区工作，外地同事打办公室电话找他，问：XX在吗？答：他不在了，调湖里去了。 对方沉默一阵子，问：怎么这么不小心？捞起来了吗？');
