insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (651,'发明','http://m.pengfu.com/content/1116124/?from=jinli','','',1419600605,1420205405,1,13,109,1419600605,1419600605,1,'意大利人和德国人争夸自己的祖先。 前几天，在罗马的地下发掘出电线了，这说明古罗马已经发明了电话。哼，你知道在柏林发现了什么吗？不知道。告诉你，什么也没有。什么也没有？是的，这证明我们的祖先早已发明了无线电。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (652,'他是谁家的孩子','http://m.pengfu.com/content/1116123/?from=jinli','','',1419600605,1420205405,1,13,109,1419600605,1419600605,1,'马埃太太正在厨房里忙碌着。 哗啦，她听到玻璃破碎声。她急急忙忙走进餐厅，发现窗玻璃破了，一只皮球滚在地板上。不一会儿，一个小男孩敲门进来，他羞怯地说：爸爸马上就会来把窗玻璃修理好的。于是马埃太太就把皮球还给了他。几分钟后，果然来了一个玻璃安');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (653,'排辈儿','http://m.pengfu.com/content/1116122/?from=jinli','','',1419600605,1420205405,1,13,109,1419600605,1419600605,1,'有一个人没有名字，被人入赘后邻居都喊他姐夫。 一次，他跟人打官司，请人写状子，当问他名字时，他说：我叫姐夫。状子递上去后，县官升堂：传姐夫上堂！当差的齐声喊道：请姑老爷上堂！县官听罢怒喝道：馄帐，什么姑老爷！差人慌忙跪下道：回禀老爷，您老的');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (654,'十分合算','http://m.pengfu.com/content/1116121/?from=jinli','','',1419600605,1420205405,1,13,109,1419600605,1419600605,1,'有个人去看医生，医生吩咐检查一下小便。 这人便从家里提来满满一大瓶小便。医生检查后，写上了并无异常。回到家里，他兴奋地向全家宣布：我没有糖尿病，你也没有，爸爸、妈和孩子们全都没有。');
