insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (794,'小学二年级的请假条','http://m.pengfu.com/content/1118254/?from=jinli','','',1419651604,1420256404,1,13,109,1419651604,1419651604,1,'亲爱的王老师:你好~!我想请假，本来我是不想的，但是爸爸昨天收保护费被人砍了，今天找不到人手，于是叫我去凑个数.王老师请您放心，我不会被人拿刀砍的.虽然我才上二年级，但是去年我已经和隔壁班的小强打过一架，他那时候是五年级，最后他被我打的拖进');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (795,'昨天晚上没想到你技术那么好','http://m.pengfu.com/content/1118253/?from=jinli','','',1419651604,1420256404,1,13,109,1419651604,1419651604,1,'陪一妹子玩了一夜的英雄联盟，第二天上课，她跑过来当着全班同学的面，对我说，“昨天晚上没想到你技术那么好！” ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (796,'下流胚子 ','http://m.pengfu.com/content/1118252/?from=jinli','','',1419651604,1420256404,1,13,109,1419651604,1419651604,1,'初中语文课的女老师刚从师大毕业，什么都好，就是喜欢突击式地抽同学上黑板默写名词解释。 方法是，老师口述某个词，同学默写，并加解释。 记得有一次，抽到一个不爱听讲的男生。老师一遍一遍地重复念“间或”，那男生抓着头皮在黑板前熬了好几分钟，突然刷');
