insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (798,' 男生比较少的好处','http://m.pengfu.com/content/1118250/?from=jinli','','',1419651604,1420256404,1,13,109,1419651604,1419651604,1,'我是文科班的学生，班里男女生比例是1∶5。 前几天中午，医务室的老师来检查卫生。她在我们班来回走走，看了看说：“这班男生真少啊！ ”又思考一会儿，说：“怪不得空气这么好！ ”');
