insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (814,'小小鸟','http://m.pengfu.com/content/1118453/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'儿子春游回来说:爸爸，我小鸟有点痒。 我妈一听，爱孙心切:快，让奶奶看咋回事？儿子马上不干了:不行，奶奶是女的！猛的来了，我妈一把抓过儿子说:女的咋了？别说你，你爸，你爷爷我都看过，你个小小鸟……');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (815,'阿凡提：唱了一天歌','http://m.pengfu.com/content/1118452/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'一天，阿凡提没到学校去。 第二天老师问他：“昨天你为什么没到学校来？” 　　“我到医院去了。”阿凡提答。 　　“难道你病了？”老师问。 　　“不，我哥到医院拔了一颗牙。我怕别人听见他的哀叫声，我就站在家门口唱了一天歌。”阿凡提回答说。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (816,'阿凡提：先找父亲','http://m.pengfu.com/content/1118451/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'古尔邦节那天，阿凡提的父母带着他到喀什最大的巴扎游玩。 节日的巴扎热闹非凡、人头躜动。阿凡提只顾看热闹却走失了父母，他只好在人群中大声叫嚷道：“大哥、大姐们，叔叔、大爷们，我把父母丢了，请帮我找一下，哪怕把父亲找回来也行，我将有赏钱给你们。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (817,'阿凡提：它想起了童年','http://m.pengfu.com/content/1118450/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'一群孩子在院子里玩球。 阿凡提也来到孩子们中间，与孩子们一起玩了起来。玩着玩着，有一个调皮的孩子，一把将阿凡提头上的色兰抢了过来，扔到空中玩耍起来。其他孩子们也一哄而上，玩起阿凡提的色兰来。阿凡提哪能跑得过这些顽皮的孩子呢，他东跑西颠地想把');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (818,'贱人','http://m.pengfu.com/content/1118449/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'有个美女站在楼上准备轻生。 一男见后上前抱住她，美女心存感激，于是跟他来了一发。事后男子问：小姐，你这么漂亮。为什么要寻短见呢？美女：哎。得了艾滋，晚期了。男子：WQNMB，你这个贱人。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (819,'  阿凡提：给钱的人才能吹口笛','http://m.pengfu.com/content/1118448/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'一天，阿凡提要去赶集。 一群孩子围过来异口同声地求他道：“阿凡提大叔，给我带一支口笛吧！给我带一支口笛吧！” 　　其中一位小孩很有礼貌地把一些零钱恭恭敬敬地递到阿凡提跟前，说道：“阿凡提大叔，麻烦您给我带一支口笛吧！” 　　阿凡提接过孩子手');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (820,'阿凡提：把筐也拿去吧！','http://m.pengfu.com/content/1118447/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'孩子们喜欢跟阿凡提开玩笑。 一天，阿凡提在河边钓鱼。一群调皮的孩子悄悄来到他的身后，把他好不容易钓到的鱼，一条一条地从筐里拿出，扔回到河里。过了一会儿，阿凡提发现装鱼的筐空了，便知道这准是孩子们干的。 　　阿凡提若无其事地抓过空筐顺手扔进河');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (821,'阿凡提：驴可能飞上天了','http://m.pengfu.com/content/1118446/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'阿凡提小时候，有一次跟父亲出远门，他们在一个偏僻的外乡落脚住宿。 睡觉前父亲对他说：“阿凡提，你去用一根长绳把驴拴在草地上，让它自己吃青。咱明早继续赶路。” 　　“爸爸，我们还是一人睡一人看护它吧，不然它被狼吃了或者被人偷了怎么办？”阿凡提');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (822,'秒懂有木有','http://m.pengfu.com/content/1118445/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'某男在女友脖子上吻了个草莓，被七岁的小侄女看到，　　侄女说：“阿姨，你脖子怎么回事啊？”　　不好意思的回答：“被狗咬的。 ”　　侄女惊讶的说：“啊？那你打针没有，会得狂犬病的。”　　某女淡定的答：“打了，昨晚刚打了！”　　秒懂的有木有？');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (823,'  阿凡提：平分','http://m.pengfu.com/content/1118444/?from=jinli','','',1419659405,1420264205,1,13,109,1419659405,1419659405,1,'阿凡提上学的时候，一次父亲恐吓他说：“这一次如果考试不及格，我要打断你的腿！” 　　“不用，如果您给我十块银币，我准能考试及格。 ”阿凡提说。 　　“要十块银币干什么？”父亲奇怪地问。 　　“我和毛拉平分呀！”阿凡提回答说。');
