insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (833,'确实挺好','http://m.pengfu.com/content/1118470/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'陪女友逛街，看到路边有很多卖平安果和鲜花的，我拉着她的手深情地说：“亲爱的你知道吗，平安夜男生要送平安果和鲜花给心爱的女生。 ” 女友羞涩地点了点头。我接着说道：“早知道咱们也批发些平安果和鲜花来卖了，生意一定很好。”');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (834,'孽徒','http://m.pengfu.com/content/1118469/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'“孽徒！为师养你育你这么多年你就用这种方式报答我么？！”男子可怜兮兮的看着他：“师父……就一次还不行么？”“不行！记得师门教诲是什么么？！”男子不情愿的从他身上爬起来揖拜道：“记得，师父在上……”还没说完就被扑倒，“乖徒儿，知道谁在上面就好');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (835,'以前是怎么过的?','http://m.pengfu.com/content/1118468/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'我 ：老爸，现这世界不是手机就是电脑的，你以前没这些玩意是怎么过的啊？ 爸爸 ：特么的，净问这没用的，还不叫你十四弟回来吃饭！ ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (836,'所以说知识改变命运','http://m.pengfu.com/content/1118467/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'老师：今早有一个新闻，有一个小孩被车撞了飞出80米毫发无伤，因为底下被满满是书的书包垫了没事。 所以说知识改变命运。小明：如果不是背这么重的书包他早走过马路了。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (837,'去见未来丈母娘','http://m.pengfu.com/content/1118466/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'今天跟女朋友去见未来丈母娘。 她一眼就认出我来了，对我的态度真心不错。我会告诉你上星期我花了500块钱请了个人故意去跟我丈母娘吵架，后来我来劝架，把那个人教训了一顿。当时丈母娘还要给我介绍女朋友，我当时就说我已经有女朋友了。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (838,'刚做手术不久吧！没事会习惯的。','http://m.pengfu.com/content/1118465/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'一觉醒来我发现我遗精了。 我兴奋的告诉妈妈我长大了。可是突然觉得不对劲！怎么会是红色的呢？？想到这里突然觉得很可怕拉开裤子看看:我靠，我的弟弟呢？我就急了翻箱倒柜的找啊找！都急哭了！这时妈妈过来了说:你那不叫遗精！叫大姨妈！一拍脑袋才想起来');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (839,'老师，我问个问题','http://m.pengfu.com/content/1118464/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'小明：“老师，我问个问题。 ” 老师：“滚出去！” 小明：“我真是要问个问题！您看清楚，是个数学问题啊！” 老师：“滚出去！” 小明：“现在的女老师真没有职业道德！”小明说完走出了女厕所！');
