insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (841,'我就是想日','http://m.pengfu.com/content/1118462/?from=jinli','','',1419663603,1420268403,1,13,109,1419663603,1419663603,1,'月亮不分昼夜的围着地球的身边转，地球却置之不理，依然围着太阳转，哪怕是冒着熊熊的火、灼眼的光。  有一天，星星问地球：“你为什么放着喜欢你月球不要，而偏偏冒死去追太阳？” 地球无奈的说：“我就是想日。');
