insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (868,'阿凡提：地狱在哪儿？','http://m.pengfu.com/content/1118559/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'一天，国王问阿凡提：“十八层地狱的位置在哪儿？” 　　“陛下。 我想十八层地狱的位置大概在属于您的那些十八个地牢的底下。”阿凡提回答道。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (869,'阿凡提：跟驴的脑子换一下','http://m.pengfu.com/content/1118558/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'阿凡提害过一场病后，耳朵有些不好使了。 一天，国王讥讽他说：“阿凡提，你的耳朵越来越不好使了，是不是请你把耳朵跟你那头驴的耳朵换一下？” 　　“不用，我耳朵够用了。我看您脑子不太够用，我倒希望您把您的脑子跟我这头驴的脑子换一下。”阿凡提回答');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (870,'阿凡提：在马背上','http://m.pengfu.com/content/1118557/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'一位经常骑着马炫耀自己的入企图讥讽阿凡提。  　　一天，他骑着一匹高头大马问阿凡提：“阿凡提，此刻你的驴在哪儿？” 　　“此时此刻我的驴正在马背上。”阿凡提答复他说。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (871,'阿凡提：挖掘坟墓','http://m.pengfu.com/content/1118556/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'一天，毛拉问阿凡提：“你将来打算怎样为国王效力？” 　　“我至少可以为国王挖掘坟墓！”阿凡提回答道。 ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (872,'阿凡提：有真凭实据吗？','http://m.pengfu.com/content/1118555/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'阿凡提的毛驴被人偷去了，他怀疑是村里人所为。 便告到了喀孜那里，喀孜对他说：“阿凡提，你没有亲眼看见，又没有亲手抓住，没有真凭实据，本官不予受理。”说完，就把阿凡提轰了出去。 　　过了几天，阿凡提神不知鬼不觉地把喀孜的那匹高头大马骑到集市上');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (873,'阿凡提：它也可以当国王','http://m.pengfu.com/content/1118554/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'国王来到阿凡提的磨坊，看见拉磨的驴脖子上挂了两个大铃挡，便问阿凡提：“阿凡提，你为什么要在驴脖子上挂两个大铃挡，难道它不累吗？” 　　阿凡提说：“陛下，有时我睡着了，这畜牲也偷懒停下，它一停下铃挡就不响了，我就可以醒来狠狠地抽它一鞭。 ” ');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (874,'阿凡提：斜眼','http://m.pengfu.com/content/1118553/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'阿凡提的眼睛有一点斜。 国王在众人面前想拿他开心，说道：“阿凡提，斜眼的人看东西是不是双重的？” 　　“是的，国王陛下，现在我看你就像是有四条腿。”阿凡提回答说。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (875,'阿凡提：愚蠢','http://m.pengfu.com/content/1118552/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'阿凡提在街上故意向人们夸耀自己说：“昨天国王把我唤去封我为他的右丞相。 ” 　　听见此话的一人问他：“阿凡提，你这个愚蠢的家伙，胡说些什么呀！” 　　“对，如果我不愚蠢国王能让我当他的右丞相吗？”阿凡提说。');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (876,'阿凡提：县官与他的驴','http://m.pengfu.com/content/1118551/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'县官的驴丢了，他把阿凡提找来对他说：“阿凡提，你多次丢失过驴，找驴有经验，请帮助我找一下。 ” 　　阿凡提开始走街串巷找驴，可他一边走一边唱着歌。一位朋友见了他如此高兴，问道： 　　“阿凡提，你这么愉快，怕是有什么喜事吧！” 　　“县官的驴');
insert  into `3g_localnav_list`(`id`,`name`,`link`,`img`,`color`,`start_time`,`end_time`,`status`,`type_id`,`column_id`,`created_at`,`updated_at`,`sort`,`ext`) values (877,'阿凡提：不敢让您见到我的脸','http://m.pengfu.com/content/1118550/?from=jinli','','',1419675005,1420279805,1,13,109,1419675005,1419675005,1,'阿凡提椰揄了国王，使国王非常愤怒，他冲着阿凡提喊道：“滚！别让我再见到你的脸！”国王说完就把阿凡提驱逐出了王宫。  　　过了几天，从邻国来了几位使者。国王对使者们提出的问题没能答上来，只好又把阿凡提叫来。 　　阿凡提躬着身，背朝国王倒着走到');
